INSERT INTO `block_custom` VALUES (1,'        <div class=\"container\">\r\n            <div class=\"row\">\r\n                <div class=\"span4\">\r\n                    <h2>Minnehaha<i>Lofts</i></h2>\r\n                </div>\r\n                <div class=\"span4\">\r\n                    <h2><i class=\"icon-globe icon-white jarak-kecil\"></i>Social Networking</h2>\r\n                    <p>\r\n                        <i class=\"icon-twitter icon-white\"></i><a href=\"https://twitter.com/minnehahalofts\" target=\"_blank\">Follow Us on Twitter</a><i class=\"icon-twitter icon-white\"></i>\r\n                    </p>\r\n                    <p>\r\n                        <i class=\"icon-fb icon-white\"></i> <a href=\"http://www.facebook.com/minnehahalofts\" target=\"_blank\">MinnehahaLofts on Facebook</a>\r\n                    </p>\r\n                    <p>\r\n                        <i class=\"icon-gp icon-white\"></i> <a href=\"https://plus.google.com/u/0/b/100411277821392796298/100411277821392796298/posts\" target=\"_blank\">MinnehahaLofts on Google+</a>\r\n                    </p>\r\n                </div>\r\n                <div class=\"span4\">\r\n<!--                    <g:form name=\"inquireForm\" id=\"inquireForm\" url=\"[action:\'process\',controller:\'inquiry\']\">-->\r\n                        <!--<form name=\"inquireForm\" id=\"inquireForm\" method=\"post\" action=\"inquiry/process\"> -->\r\n                        <h2><i class=\"icon-envelope icon-white jarak-kecil\"></i>Inquire</h2>\r\n                        <p><textarea rows=\"3\" name=\"inqContent\">Type your inquiry here.</textarea></p>\r\n                        <input type=\"hidden\" name=\"sourceUrl\" value=\"/${controllerName}/${actionName}\">\r\n                        <div class=\"input-prepend\">\r\n                            <span class=\"add-on\">E-Mail</span><input class=\"span2\" id=\"prependedInput\" name=\"userEmail\" size=\"16\" type=\"text\" >\r\n                            <a class=\"btn btn-success\" id=\"submitInq\" href=\"#\"><i class=\"icon-ok icon-white\"></i>Inquire</a>\r\n                        </div>\r\n                        <!--</form>  -->\r\n<!--                    </g:form>-->\r\n                </div>\r\n            </div>\r\n\r\n            <hr />\r\n\r\n            <footer><p>copyright <span class=\"minilogo\">&nbsp;Minnehaha<i>Lofts</i></span> &copy; 2012. Created by : <a href=\"http://www.kapasoft.com\">KapaSoft</a></p></footer>\r\n\r\n        </div>','footer for minnehaha theme','full_html'),(2,'<div class=\"ganti-warna\">\r\n    <div class=\"pilihan-warna\">\r\n        <ul>\r\n            <li><a href=\"${createLink(action: \'riga\')}\">Cozy Apt - <span style=\"display:block;margin-left: 25px;margin-top: -5px\">Riga</span></a></li>\r\n            <li><a href=\"${createLink(action: \'sydney\')}\">Charming Home - <span style=\"display:block;margin-left: 25px;margin-top: -5px\">Sydney</span></a></li>\r\n            <li><a href=\"${createLink(action: \'minnehaha\')}\">Cute Home - <span style=\"display:block;margin-left: 25px;margin-top: -5px\">Minnehaha</span></a></li>\r\n        </ul>\r\n    </div>\r\n</div>','Sticky Property Menu','full_html'),(3,'<div class=\"span7 logo\">\r\n            <h1><a href=\"${createLink(uri: \'/\')}\">Minnehaha<i>Lofts</i></a> </h1>\r\n            <p>Welcome Home!</p>\r\n</div>','Minnehaha Logo','full_html'),(4,'<ul class=\"nav nav-list\">\r\n                    <li class=\"nav-header\">Locations</li>\r\n                    <li class=\"#\"><a href=\"${createLink(action: \'sydney\')}\"><i class=\"icon-home\"></i> Charming Home - Sydney</a></li>\r\n                    <li><a href=\"${createLink(action: \'minnehaha\')}\"><i class=\"icon-home\"></i> Cute Home - Minnehaha</a></li>\r\n                    <li><a href=\"${createLink(action: \'riga\')}\"><i class=\"icon-home\"></i> Cozy Apt - Riga</a></li>\r\n                    <li class=\"divider\"></li>\r\n</ul>','List of properties organized into Location menu ','full_html'),(5,'<ul class=\"nav nav-list\">\r\n      <li class=\"nav-header\">Other</li>\r\n      <li><a href=\"#\"><i class=\"icon-map-marker\"></i> Map</a></li>\r\n      <li><a href=\"${createLink(action: \'testimonial\')}\"><i class=\"icon-comment\"></i> Testimonials</a></li>\r\n</ul>','Other Menu that lists other than Basic and Property pages','full_html'),(6,'<form><h2><i class=\"icon-envelope jarak-kecil\"></i>My Testimonial</h2>\r\n<label>Title </label><input class=\"span6\" type=\"text\" class=\"input-small\" name=\"title\" placeholder=\"Testimonial Title\" value=\"\">\r\n<label>My Testimonial</label><textarea class=\"input-xlarge span6\" id=\"content\" name=\"content\" placeholder=\"Type your testimonial here.\" value=\"\"></textarea><label>Nickname</label><input class=\"span6\" type=\"text\" name=\"submittedBy\" placeholder=\"Type name as you wish it appear on the testimonial\" value=\"\">\r\n<label>I\'d Recommend This Property For:</label><textarea class=\"input-xlarge span6\" id=\"recommendedFor\" name=\"recommendedFor\" placeholder=\"For example, adventure seekers, romantic gateway, Age 55+...\" value=\"\"></textarea>\r\n<input type=\"hidden\" name=\"sourceUrl\" value=\"/${controllerName}/${actionName}\">\r\n<input type=\"hidden\" name=\"unitName\" value=\"${webRequest.actionName}\">\r\n<p class=\"mutedMin\">\r\n<input class=\"span4\" type=\"text\" id=\"preventRobots\" name=\"preventRobots\" value=\"Please, delete this text to leave it blank\"><span class=\"help-inline mn-help-inline\">(this prevents robots submit form)</span>\r\n</p>\r\n<br/><button id=\"testimonialSubmitBt\" type=\"button\" class=\"btn btn-primary\">Send Testimonial</button>\r\n</form>','Leaving testimonial form','full_html'),(7,'<form>\r\n<h2><i class=\"icon-envelope jarak-kecil\"></i>Inquire</h2>\r\n<p><textarea class=\"input-xlarge span6\" name=\"inqContent\" value=\"\">Type your inquiry here.</textarea></p>\r\n<input type=\"hidden\" name=\"sourceUrl\" value=\"/${controllerName}/${actionName}\">\r\n<input type=\"hidden\" name=\"unitName\" value=\"${webRequest.actionName}\">\r\n<p class=\"mutedMin\">\r\n<input class=\"span4\" type=\"text\" id=\"preventRobots\" name=\"preventRobots\" value=\"Please, delete this text to leave it blank\"><span class=\"help-inline mn-help-inline\">(this prevents robots submit form)</span>\r\n</p>\r\n<div class=\"input-prepend\"><span class=\"add-on\">E-Mail</span><input class=\"span2\" id=\"prependedInput\" name=\"userEmail\" size=\"16\" type=\"text\" value=\"\"><a class=\"btn btn-success\" id=\"submitCentralInq\" href=\"#\"><i class=\"icon-ok icon-white\"></i>Inquire</a></div>\r\n</form>','Unit Inquiry Form','full_html');
