INSERT INTO `cache_field` VALUES ('field:node:1','a:4:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2722:\"        <p>\r\n          We pride ourselves for providing home-like accommodations for our guest while visiting Twin Cities. Minneahaha Lofts offers beautifully remodeled properties that offer high quality furnishings and are well maintained. It is important for us that our guests have memorable furnished home experience.\r\n          </p>\r\n        <blockquote>\r\n          <p>Comfortable and pleasant home like stay while away!</p>\r\n          <small>Minnehaha Lofts slogan</small>\r\n        </blockquote>\r\n        <div class=\"row\">\r\n          <div class=\"span3\">\r\n           The name \'Minnehaha\' comes from \'Minnehaha Falls\' a beautiful historic park in the neighborhood to enjoy while you stay with us. We provide accommodations in a beautiful part of Minneapolis around Lake Nokomis next to the Mississippi river. While being near so many attractions and also near downtown, you still are able to be outside to have privacy and sense of home. Light rail train few blocks away makes it convenient  to commute. A close-by bike trail makes it easy to explore this beautiful city.</p>\r\n          </div>\r\n          <div class=\"span3\">\r\n            <div class=\"thumbnail\">\r\n             <img src=\"sites/default/files/extra-photo/MinnehahaFalls.jpg\" alt=\"\"> \r\n              <div class=\"caption\">\r\n                <h5>Minnehaha Falls </h5>\r\n                <p>One of the many attractions in the neighborhood </p>\r\n\r\n              </div>\r\n            </div>\r\n          </div>\r\n          <div class=\"span3\">\r\n            <div class=\"thumbnail\">\r\n              <img src=\"sites/all/themes/minnehaha/img/minnehaha/minneapolis_spoon.jpg\" alt=\"\">\r\n              <div class=\"caption\">\r\n                <h5>Minneapolis Sculpture Garden</h5>\r\n                <p>There is something for everyone</p>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <hr>\r\n        <p>\r\n         We have a passion in providing accomodations that our guests will remember as one of the best things about their experience in the Twin Cities. We strive to distinguish ourselves by offering a quality, unique home-like stay experience. Convenience and comfort is an important part of our service.\r\n        </p>\r\n        <p>\r\n          To summarize, Minnehaha Lofts offers:\r\n        </p>\r\n        <ul style=\"list-style:none;\">\r\n        <li><i class=\"icon-play-circle\"></i>Unique home-like accommodations with the highest quality standards </li>\r\n        <li><i class=\"icon-play-circle\"></i>Located in beautiful a part of the city near many attractions, yet apart to have your privacy</li>\r\n        <li><i class=\"icon-play-circle\"></i>Gracious hosts that committed to you having a pleasant vacation home experience</li>\r\n      </ul>\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:2350:\"<p>\n          We pride ourselves for providing home-like accommodations for our guest while visiting Twin Cities. Minneahaha Lofts offers beautifully remodeled properties that offer high quality furnishings and are well maintained. It is important for us that our guests have memorable furnished home experience.\n          </p>\n<blockquote><p>Comfortable and pleasant home like stay while away!</p>\n<p>          <small>Minnehaha Lofts slogan</small>\n        </p></blockquote>\n<div class=\"row\">\n<div class=\"span3\">\n           The name \'Minnehaha\' comes from \'Minnehaha Falls\' a beautiful historic park in the neighborhood to enjoy while you stay with us. We provide accommodations in a beautiful part of Minneapolis around Lake Nokomis next to the Mississippi river. While being near so many attractions and also near downtown, you still are able to be outside to have privacy and sense of home. Light rail train few blocks away makes it convenient  to commute. A close-by bike trail makes it easy to explore this beautiful city.\n</div>\n<div class=\"span3\">\n<div class=\"thumbnail\">\n             <img src=\"sites/default/files/extra-photo/MinnehahaFalls.jpg\" alt=\"\" /><div class=\"caption\">\n<h5>Minnehaha Falls </h5>\n<p>One of the many attractions in the neighborhood </p>\n</div>\n</div>\n</div>\n<div class=\"span3\">\n<div class=\"thumbnail\">\n              <img src=\"sites/all/themes/minnehaha/img/minnehaha/minneapolis_spoon.jpg\" alt=\"\" /><div class=\"caption\">\n<h5>Minneapolis Sculpture Garden</h5>\n<p>There is something for everyone</p>\n</div>\n</div>\n</div>\n</div>\n<hr /><p>\n         We have a passion in providing accomodations that our guests will remember as one of the best things about their experience in the Twin Cities. We strive to distinguish ourselves by offering a quality, unique home-like stay experience. Convenience and comfort is an important part of our service.\n        </p>\n<p>\n          To summarize, Minnehaha Lofts offers:\n        </p>\n<ul style=\"list-style:none;\"><li><i class=\"icon-play-circle\"></i>Unique home-like accommodations with the highest quality standards </li>\n<li><i class=\"icon-play-circle\"></i>Located in beautiful a part of the city near many attractions, yet apart to have your privacy</li>\n<li><i class=\"icon-play-circle\"></i>Gracious hosts that committed to you having a pleasant vacation home experience</li>\n</ul>\";s:12:\"safe_summary\";s:0:\"\";}}}s:17:\"field_page_slogan\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:34:\"...introduced with Minnehaha Lofts\";s:6:\"format\";N;s:10:\"safe_value\";s:34:\"...introduced with Minnehaha Lofts\";}}}s:29:\"field_header_background_image\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:1:\"5\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:3:\"700\";s:6:\"height\";s:3:\"150\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:15:\"head_page_1.jpg\";s:3:\"uri\";s:51:\"public://basic