</span> © 2012. Created by : <a href=\"http://www.kapasoft.com\">KapaSoft</a></p>\n<p></p></footer></p>\n</div>\n',0,1366857908,0),('full_html::8e319cec4285ce565f6a2594bc1b11891b56d43e5959c276d18508def69dbbc3','<form>\n<h2><i class=\"icon-envelope jarak-kecil\"></i>My Testimonial</h2>\n<p><label>Title </label><input class=\"span6\" type=\"text\" name=\"title\" placeholder=\"Testimonial Title\" value=\"\" /><br /><label>My Testimonial</label><textarea class=\"input-xlarge span6\" id=\"content\" name=\"content\" placeholder=\"Type your testimonial here.\" value=\"\"></textarea><label>Nickname</label><input class=\"span6\" type=\"text\" name=\"submittedBy\" placeholder=\"Type name as you wish it appear on the testimonial\" value=\"\" /><br /><label>I\'d Recommend This Property For:</label><textarea class=\"input-xlarge span6\" id=\"recommendedFor\" name=\"recommendedFor\" placeholder=\"For example, adventure seekers, romantic gateway, Age 55+...\" value=\"\"></textarea><br /><input type=\"hidden\" name=\"sourceUrl\" value=\"/${controllerName}/${actionName}\" /><br /><input type=\"hidden\" name=\"unitName\" value=\"${webRequest.actionName}\" /></p>\n<p class=\"mutedMin\">\n<input class=\"span4\" type=\"text\" id=\"preventRobots\" name=\"preventRobots\" value=\"Please, delete this text to leave it blank\" /><span class=\"help-inline mn-help-inline\">(this prevents robots submit form)</span>\n</p>\n<p><br /><button id=\"testimonialSubmitBt\" type=\"button\" class=\"btn btn-primary\">Send Testimonial</button><br /></p></form>\n',0,1366857908,0),('full_html::a8a7538b3aa4fd7e744c98b8bf3b5654a339ba04d5f5f31f9f2350adef53d97e','<div class=\"ganti-warna\">\n<div class=\"pilihan-warna\">\n<ul><li><a href=\"${createLink(action: \'riga\')}\">Cozy Apt - <span style=\"display:block;margin-left: 25px;margin-top: -5px\">Riga</span></a></li>\n<li><a href=\"${createLink(action: \'sydney\')}\">Charming Home - <span style=\"display:block;margin-left: 25px;margin-top: -5px\">Sydney</span></