INSERT INTO `field_data_body` VALUES ('node','page',0,1,1,'und',0,'        <p>\r\n          We pride ourselves for providing home-like accommodations for our guest while visiting Twin Cities. Minneahaha Lofts offers beautifully remodeled properties that offer high quality furnishings and are well maintained. It is important for us that our guests have memorable furnished home experience.\r\n          </p>\r\n        <blockquote>\r\n          <p>Comfortable and pleasant home like stay while away!</p>\r\n          <small>Minnehaha Lofts slogan</small>\r\n        </blockquote>\r\n        <div class=\"row\">\r\n          <div class=\"span3\">\r\n           The name \'Minnehaha\' comes from \'Minnehaha Falls\' a beautiful historic park in the neighborhood to enjoy while you stay with us. We provide accommodations in a beautiful part of Minneapolis around Lake Nokomis next to the Mississippi river. While being near so many attractions and also near downtown, you still are able to be outside to have privacy and sense of home. Light rail train few blocks away makes it convenient  to commute. A close-by bike trail makes it easy to explore this beautiful city.</p>\r\n          </div>\r\n          <div class=\"span3\">\r\n            <div class=\"thumbnail\">\r\n             <img src=\"sites/default/files/extra-photo/MinnehahaFalls.jpg\" alt=\"\"> \r\n              <div class=\"caption\">\r\n                <h5>Minnehaha Falls </h5>\r\n                <p>One of the many attractions in the neighborhood </p>\r\n\r\n              </div>\r\n            </div>\r\n          </div>\r\n          <div class=\"span3\">\r\n            <div class=\"thumbnail\">\r\n              <img src=\"sites/all/themes/minnehaha/img/minnehaha/minneapolis_spoon.jpg\" alt=\"\">\r\n              <div class=\"caption\">\r\n                <h5>Minneapolis Sculpture Garden</h5>\r\n                <p>There is something for everyone</p>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <hr>\r\n        <p>\r\n         We have a passion in providing accomodations that our guests will remember as one of the best things about their experience in the Twin Cities. We strive to distinguish ourselves by offering a quality, unique home-like stay experience. Convenience and comfort is an important part of our service.\r\n        </p>\r\n        <p>\r\n          To summarize, Minnehaha Lofts offers:\r\n        </p>\r\n        <ul style=\"list-style:none;\">\r\n        <li><i class=\"icon-play-circle\"></i>Unique home-like accommodations with the highest quality standards </li>\r\n        <li><i class=\"icon-play-circle\"></i>Located in beautiful a part of the city near many attractions, yet apart to have your privacy</li>\r\n        <li><i class=\"icon-play-circle\"></i>Gracious hosts that committed to you having a pleasant vacation home experience</li>\r\n      </ul>','','full_html'),('node','page',0,3,3,'und',0,'        <ul class=\"nav nav-list\">\r\n          <li class=\"nav-header\"> <i class=\"icon-wrench\"></i> How do I make a reservation?</li>\r\n        </ul>\r\n        <p>\r\n          In order to make a reservation, we ask for a 50% deposit and a signed rental agreement. After, we receive both, we update the unit calendar and, at that point, your reservation is complete and we will send a confirmation email. Upon arrival, the balance of the rent is due along with the damage deposit and cleaning fee\r\n        </p>\r\n        <ul class=\"nav nav-list\">\r\n          <li class=\"nav-header\"> <i class=\"icon-wrench\"></i> Is there a damage deposit?</li>\r\n        </ul>\r\n        <p>\r\n          Yes, we ask for $500 damage deposit. To make it easier, the damage deposit can be a separate check which we can hold and return (if no damage).\r\n        </p>\r\n        <ul class=\"nav nav-list\">\r\n          <li class=\"nav-header\"> <i class=\"icon-wrench\"></i> Is there a cleaning fee?</li>\r\n        </ul>\r\n        <p>\r\n         We ask for a cleaning fee in amount of $75 for guests staying longer than 6 days. For guests staying less than 5 days the cleaning fee is waived\r\n        </p>\r\n        <p>Please let us know if you have questions. <a href=\"${createLink(action: \'contactus\')}\">We would like to hear from you!</a></p>\r\n','','full_html'),('node','page',0,4,4,'und',0,'                <g:each var=\"review\" in=\"${reviews}\">\r\n                    <div class=\"row\">\r\n                        <div class=\"span3\">\r\n                            <img alt=\"\" class=\"img-circle\" src=\"${createLinkTo(dir: review.imgUrl.tokenize(\'/\')[0..-2].join(\'/\').toLowerCase(), file: review.imgUrl.tokenize(\'/\')[-1])}\">\r\n                        </div>\r\n                        <div class=\"span6\">\r\n                            <blockquote>\r\n                                <p>${review.content} </p>\r\n                                <small>${review.submittedBy} ${review.dateReceived.toString(\"MMM d, yyyy\")}</small>\r\n\r\n                            </blockquote>\r\n                        </div>\r\n                    </div>\r\n                    <hr>\r\n                </g:each>','','filtered_html'),('node','contact_us',0,5,5,'und',0,'            <p>\r\n            Please let us know if you have questions. We would like to hear from you!\r\n        </p>\r\n        <form>\r\n            <label>Name</label>\r\n            <input class=\"span6\" type=\"text\" name=\"name\" class=\"input-small\" placeholder=\"Your Name\" value=\"\">\r\n            <label>Email Address</label>\r\n            <input class=\"span6\" type=\"text\" name=\"email\" placeholder=\"youremail@email.com\" value=\"\">\r\n            <label>Phone Number</label>\r\n            <input class=\"span6\" type=\"text\" name=\"phone\" placeholder=\"eg. 6122347829\" value=\"\">\r\n            <label>Your Message</label>\r\n            <textarea class=\"input-xlarge span6\" id=\"textarea\" name=\"message\" rows=\"6\" placeholder=\"Type your message here.\" value=\"\"></textarea>\r\n            <input type=\"hidden\" name=\"sourceUrl\" value=\"\">\r\n            <br/><button id=\"contactUsSubmitBt\" type=\"submit\" class=\"btn btn-primary\">Send to us</button>\r\n     </form>','','full_html');
/*!40000 ALTER TABLE `field_data_body` ENABLE KEYS */;
UNLOCK TABLES;

