/*!40000 ALTER TABLE `field_data_field_paragraph_about_property` DISABLE KEYS */;
INSERT INTO `field_data_field_paragraph_about_property` VALUES ('node','property',0,6,6,'und',0,'1Bdr/BA with hardwood floors and natural woodwork located two blocks from light rail station (Airport - Downtown-Mall of America). Second floor apartment in beautiful brick house has great wooden deck and big yard to barbeque or to enjoy balcony sunshine. Newly remodeled with new appliances, whirlpool, big closets and office space. ',NULL),('node','property',0,6,6,'und',1,'With easy access to light rail, it’s very easy to attend a morning conference at U of M, lunch and walk at Minnehaha Falls, afternoon shopping at Mall of America and evening dinner and show downtown. While being near so many attractions, you still can have your privacy. Summer Saturday you have farmers market next door - fresh fruits, flowers and other Minnesota grown products are available.',NULL),('node','property',0,6,6,'und',2,'Two blocks from gym with swimming pool, basketball courts and other fun activity rooms. Three blocks farther away from Minneapolis extensive bike trail network that leads you to the city of Minneapolis’ famous park and lake system. Bicycles are available to rent upon request. ',NULL),('node','property',0,13,13,'und',0,'1Br/2Ba home has hardwood floors in dining room and bedroom, marble tiled kitchen and bathroom, with beautiful woodwork throughout. All new appliances and furniture. Backyard patio shaded by big beautiful trees. Grill is provided to barbeque fresh vegetables from nearby Minnesota farmers market ',NULL),('node','property',0,13,13,'und',1,'This charming home is located in the Longfellow neighborhood which is within walking distance (ten blocks) from University of Minnesota, Mississippi River and light rail* station (eight blocks). Close to bike trail that connects to metro area trail system^(bikes are available). Tennis courts and children\'s swimming pool located three blocks away. ',NULL),('node','property',0,14,14,'und',0,'Recently remodeled one bedroom house in Nokomis Lake neighborhood waits to be your home while you are visiting Minnesota. It has hardwood floors with beautiful woodwork throughout and newly furnished with stylish furniture and all new appliances. It is located within walking distance from Minnehaha Falls and Light Rail Train station. The backyard is beautifully landscaped and offers privacy in the middle of large city. The two car garage is also available for your use. ',NULL),('node','property',0,14,14,'und',1,'Just five minutes from the airport with easy access to light rail, it’s very easy to access all that the city of Minneapolis offers - Mall of America, Minnesota Art Institute, University of Minnesota, Downtown Minneapolis and more is within ten minutes. Light rail makes it convenient to see and experience it all. ',NULL),('node','property',0,14,14,'und',2,'If you wish to feel at home while traveling, then stay at this charming house!\r\n',NULL);
/*!40000 ALTER TABLE `field_data_field_paragraph_about_property` ENABLE KEYS */;
UNLOCK TABLES;

