s we ask for 500 damage deposit to make it easier the damage deposit can be a separate check which we can hold and return if no damage  is there a cleaning fee we ask for a cleaning fee in amount of 75 for guests staying longer than 6 days for guests staying less than 5 days the cleaning fee is waived please let us know if you have questions we would like to hear from you  ',0),(4,'node',' what our guests say  reviewcontent reviewsubmittedby reviewdatereceivedtostring mmm d yyyy  ',0),(5,'node',' contact us please let us know if you have questions we would like to hear from you name email address phone number your message send to us  ',0),(6,'node',' cozy apt riga ',1366856825),(7,'node',' apartment rental rates apr 01oct 31 nov 01mar 31 125 night 750 week 1950 month 100 night 650 week 1750 month 75 waved if stay less 6 days  ',0),(8,'node',' 1br home rental rates apr 01oct 31 nov 01mar 31 150 night 950 week 2250 month 125 night 850 week 1950 month 75 waved if stay less 6 days  ',0),(9,'node',' riga content photo 1  extra office space office space  ',0),(10,'node',' riga content photo 2 extendable dining table for extra space dining table  ',0),(11,'node',' sydney content photo 1  furnished with elegant furniture high quality furnishings  ',0),(12,'node',' sydney content photo 2  enjoy wine and relax little ornaments of house  ',0),(13,'node',' charming home sydney ',1366856748),(14,'node',' cute home minnehaha ',1366856628),(15,'node',' minnehaha content photo 1 in cooler times to keep warm while entertained fireplace and tv  ',0),(16,'node',' minnehaha content photo 2 comfortable dinning room to enjoy your meal dinning set with chairs  ',0);
